INSERT INTO `solution` (`solution_id`, `solution`, `disease_id`) VALUES
(1, '<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Note: Cassava varieties such as farmer&#39;s Pride, Obasanjo 2 and Game Changer are resistant&nbsp;Cassava mosaic disease</strong></div>\r\n\r\n<p>!Cassava mosaic disease A severel mosaic disease was recognized as a serious threat to cassava cultivation in India as early as 1942. The first report on this disease was made by Alagianagalingam and Ramakrishnan (1966) African cassava mosaic disease reported by Walburg in 1984 occurs in African countries ad West Pacific islands ( Lozano and Booth 1976). There are six different viruses recorded causing mosaic symptoms on cassava. Symptomatology The first symptom appear on young leaves as chlorotic speck. Grandually they enlarge and intermix with green tissue to provide a mosaic pattern The pale discoloration may be intensified to yellow colour depending on the varieties. The leaf area is reduced and in extreme cases leaf distortion and shoe string appearance are observed. Intensity of symptoms varies with season. During humid cool and raining stage. the symptoms eepression reduced. There may be symptom variation in the same plant. In serve case of infection, the growth of the plant is affected which ultimately leads to crop loss Disease index The severity of the disease is assessed by using the following scale Grade 1- Only specks &lt; 100 sq.mm Grade 2.- wide areas of mosaic, no distortion Grade 3 &ndash;Distortion, leaf area reduction 25 % Grade 4-Distortion, leaf area reduction 25-75% Grade 5-Distortion leaf area redction &gt;75 % Maximum intensity of the disease is observed during August &ndash;October</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong><span style=\"font-size:14px\">Prevention and control</span></strong></div>\r\n\r\n<ul>\r\n	<li>For planting, choose disease-free material from safe sources</li>\r\n	<li>Choose resistant varieties if they are available&nbsp;:</li>\r\n	<li>Warning: many cultivars resistant to mosaic virus are susceptible to brown streak virus</li>\r\n	<li>Avoid planting alternative virus hosts such as castor&nbsp;<em>bean</em>&nbsp;(&nbsp;<em>Ricinus communis</em>&nbsp;) next to cassava crops</li>\r\n	<li>Avoid planting cassava if your neighbors have a cassava crop infected with the virus;&nbsp;this will be transmitted by white flies to your crop</li>\r\n	<li>Avoid the presence of plants which may harbor the vector of the virus,&nbsp;<em>Bemisia tabaci</em>&nbsp;whiteflies&nbsp;, such as tomatoes, in or near the cassava field</li>\r\n	<li>Weed regularly, particularly at the start of the crop.&nbsp;Weeds such as&nbsp;<em>Geratium</em>&nbsp;spp.&nbsp;can harbor white flies</li>\r\n	<li>Plant an intercrop of grains or legumes, such as corn or chickpeas, to repel whiteflies</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-size:14px\"><strong>Monitoring</strong></span></div>\r\n\r\n<ul>\r\n	<li>Other plants that may be affected by the disease: soybean, castor,&nbsp;<em>Datura</em>&nbsp;spp.,&nbsp;<em>Nicotiana</em>&nbsp;spp.,&nbsp;<em>Leucaena leucocephala</em>&nbsp;,&nbsp;<em>Jatropha multifida</em></li>\r\n	<li>Inspect the culture once a week and look for symptoms (note: there may be infections without symptoms).&nbsp;Consider taking control measures if 5-10 plants per acre (0.4 hectare) are affected</li>\r\n	<li>The disease is spread by white flies of the genus&nbsp;<em>Bemisia</em></li>\r\n	<li>Inspect the field for white flies in the early morning or evening, twice a week, on 20 plants.&nbsp;White flies flying away can be seen when plants are shaken</li>\r\n	<li>Apply an insecticide before the number of whiteflies reaches more than two adults per leaf on 50% of the plants</li>\r\n	<li>Catch white flies using yellow sticky traps</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Direct Fight</strong></div>\r\n\r\n<ul>\r\n	<li><strong><span style=\"font-size:16px\">There is no treatment for plants infected with viruses</span></strong></li>\r\n	<li>Uproot and bury / burn diseased plants.&nbsp;This is only effective if you act early, before many plants are sick.</li>\r\n	<li>During the next crop, rotate with a non-host crop such as sorghum or cowpea to reduce the presence of the virus in the area.</li>\r\n	<li>Controlling the vector is not beneficial - it is difficult and expensive in time and money</li>\r\n</ul>\r\n', 1),
(4, '<p>The name brown streak was given to the disease from the brown lesions which sometimes appear on young green stems. These were the first symptoms of the disease to be recognised; however stem lesions are not the most characteristic symptom of infection and occur only infrequently.<br />\r\n<br />\r\nUnlike symptoms induced by the majority of plant viruses, those of CBSD in cassava normally&nbsp;affect mature or nearly mature leaves but not expanding, immature leaves. They consist of a characteristic yellow or necrotic vein banding which may enlarge and coalesce to form comparatively large, yellow&nbsp;patches. Tuberous root&nbsp;symptoms may also be present: these consist of dark-brown necrotic areas within the tuber and reduction in root size; lesions in roots can result in post-harvest spoilage of the crop. Leaf and/or stem symptoms can occur without the development of tuber symptoms; thus, of plants with above-ground symptoms surveyed in southern Tanzania, 21% failed to develop root necrosis</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Prevention</div>\r\n\r\n<ul>\r\n	<li><strong>Use resistant or tolerant varieties if available</strong></li>\r\n	<li><strong>Use clean planting material</strong></li>\r\n	<li>Encourage neighbours to also scout their fields at the same time, particularly when CBSD has been recently reported</li>\r\n	<li>All farm implements need to be sterilised over fire or with bleach, especially when cutting cassava stems into planting materials (cuttings)</li>\r\n	<li>Intercrop cassava with maize, beans or sunflower as trap crops for the whiteflies, the main vector of the disease</li>\r\n	<li>Uproot and bury all cassava volunteer plants</li>\r\n	<li>Remove weeds to discourage habitats for the vectors</li>\r\n	<li>Harvest early, don&#39;t leave tubers for more than 9 months in the soil as this increase the chances of getting the virus</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Monitoring</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sometimes symptoms only occur on tubers, not leaves, and sometimes they only occur on leaves, not tubers</li>\r\n	<li>Symptoms may appear and disappear in young plants, but appear again in cassava plants at a later stage</li>\r\n	<li>\r\n	<ul>\r\n		<li>Leaves: patchy yellowing along the thin secondary veins which are more prominent on mature (bottom) leaves. This can spread and form bigger patches, with a &lsquo;feathery&rsquo; or &lsquo;blotchy&rsquo; appearance</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>Stems: brown streaks and spots on upper green portions and necrotic lesion on the leaf scar. May show shoot top death which can progress into die-back</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>Tubers: dry rot symptoms. Begin with localised dead areas that are yellow-brown, with a cork-like appearance, and characteristic white threads on the outside of the tuber. Some tubers have restricted growth, appearing like a series of rings stuck together</li>\r\n	</ul>\r\n	</li>\r\n	<li>Occurs alongside cassava mosaic disease (CMD) which is also spread by whiteflies and in infected planting material but the symptoms differ</li>\r\n	<li>Daily monitor for the presence of whiteflies and take action when one whitefly is seen</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Direct Control</div>\r\n\r\n<ul>\r\n	<li>Remove diseased plants and dry all stems to use them as fire wood or stakes for climbing crops like beans. However symptomless plants may still contain the virus</li>\r\n	<li>There are no chemicals against viruses</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 3),
(5, '<p>Large variations in the predominance and severity of the various symptoms described here are observed according to the location, season, aggressiveness of the occurring bacterial strains and the cassava cultivars (Maraite, 1993).<br />\r\n<br />\r\nLeaves<br />\r\n<br />\r\nLeaves show dark-green to blue, water-soaked, angular spots (1-4 mm in diameter), limited by veinlets and irregularly distributed on the lamina. With time they frequently extend and coalesce along the veins or the edges of the leaf; the central portion turns brown and the water-soaked part often becomes surrounded by a chlorotic halo. The lesions appear as translucent spots when viewed against the light. Under a magnifying glass, small droplets of exudate oozing from the central portion of the lesion are visible on the lower surface of the leaves. The droplets, which first glisten creamy-white and later yellow, are easily dissolved by rain or dew; on drying they form a thin scale. Under favourable conditions (young leaves, high soil and air humidities), water-soaked pinpoint spots develop, scattered around young angular spots. The surrounding part of the lamina turns light brown and within 2-3 days extensive areas of the leaflets become withered not only towards the tip or border of the leaflet, but also towards the base. The affected parts show light-brown and green zonations as if they had been superficially burnt. These necrotic areas are not translucent, no bacterial exudate is observed and bacteria are absent or present in only very limited amounts at the borders of the extending blight lesions. A severe attack leads to premature drying and shedding of the leaves.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Prevention</div>\r\n\r\n<ul>\r\n	<li><strong>Plant healthy cuttings. Infected cuttings do not show any symptoms of bacterial blight. Obtain planting material from trusted sources or areas free from the disease</strong></li>\r\n	<li><strong>Use resistant or tolerant cultivars if available</strong></li>\r\n	<li>Avoid planting on land with history of CBB</li>\r\n	<li>Practice crop rotation with cereals such as sorghum or maize, or with legumes such as bean, soybean or groundnuts. The rotation must take place for four seasons before planting cassava again</li>\r\n	<li>Sterilize tools used to prepare cuttings with fire for 2 minutes or wash tools with bleach: 5 parts bleach, 95 parts water. Tools can otherwise spread the disease</li>\r\n	<li>Avoid transferring planting materials from CBB endemic areas to new cassava fields</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Monitoring</div>\r\n\r\n<ul>\r\n	<li>Regularly visit fields (at least twice a month) beginning 3 months after planting and particularly when conditions are wet</li>\r\n	<li>When an infected cutting starts to grow the new shoots wilt and the stem dies back</li>\r\n	<li>Implement control when symptoms are seen at any stage of growth</li>\r\n	<li>Leaves:</li>\r\n	<li>\r\n	<ul>\r\n		<li>First symptoms are small dark-green to blue leaf spots which are angular and water-soaked</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>Later, the spots enlarge and join up, often along the leaf edge</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>Yellow patches spread outwards from the leaf spots as the leaf withers and droops</li>\r\n	</ul>\r\n	</li>\r\n	<li>Stems and leaves:</li>\r\n	<li>\r\n	<ul>\r\n		<li>Produce a sticky ooze, containing bacteria</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>Dark areas (lesions) develop along the leaf stalks and woody stems. Leaves wilt without developing any leaf spots</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>The soft tissue at the top of the growing shoot dies, giving plants a characteristic &lsquo;candle&rsquo; appearance. New leaves grow out lower down the stem but they will also eventually die</li>\r\n	</ul>\r\n	</li>\r\n	<li>Symptoms are evident during rainy season, especially in high altitude (&gt;1600m)</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Direct Control</strong></div>\r\n\r\n<ul>\r\n	<li>If only a few plants in a field show symptoms, speedy removal may reduce further spread</li>\r\n	<li>Dispose of infected plants by uprooting and burying deeply (at 50 cm) or burning to avoid keeping a source of inoculums</li>\r\n	<li>Minimise the movement of livestock and people in infected fields as they can spread the disease, especially when conditions are wet</li>\r\n	<li>Once the field is infected, practice crop rotation at least four seasons before planting cassava again in the same field</li>\r\n	<li>There is no chemical treatment for controlling the disease</li>\r\n</ul>\r\n', 4),
(6, '<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Root rot diseases are very important because rotten storage roots of cassava are unwholesome for consumption. Severe outbreaks of root rot diseases on a large scale may result in food shortages or even threaten food security in communities that depend very much on cassava as a major staple food. Root rot diseases may lead to death of entire plants - a situation that can&nbsp; affect the availability of planting materials and leafy vegetables. Root rot diseases can also affect the supply of storage roots to large scale processing factories that depend on cassava as the only raw material.</p>\r\n\r\n			<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>How do you control Root rot disease?</strong></div>\r\n\r\n			<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Site and Land Selection</strong></div>\r\n\r\n			<p>One important characteristic of land suitable for cassava cultivation is that it should not be subject to flooding. Waterlogged soils also promote root rot diseases and must be avoided at all times. Farming close to rivers and streams must be avoided as these areas are likely to be flooded at some time in the year. A sandy loamy soil that is well drained is a good soil type for cassava.<br />\r\n			<br />\r\n			It is advisable not to cultivate cassava on land that has a history of root rots and other major diseases. Any land showing the presence of any of the root rot causing mushrooms described above should not be planted to cassava. If the only land available for cassava cultivation has a history of root rots, then good disease management practices must be maintained if good yields are expected.<br />\r\n			<br />\r\n			Land suitable for cassava production must be fertile enough to give a healthy crop of plants. Healthy plants are not easily attacked by diseases. Fertility of poor soils can be improved through the addition of organic fertilizers such as poultry manure if inorganic fertilizers prove too expensive</p>\r\n\r\n			<p><strong><em>Disease Resistant or Tolerant Varieties</em></strong></p>\r\n\r\n			<p>Farmers are always advised to plant disease resistant or tolerant varieties if they are available. In localities with a long history of root rot diseases, farmers must consult their Agricultural Extension agents for advice on the best varieties to cultivate to minimize losses in yields. Results of work in&nbsp;<em>Polyporus</em>&nbsp;endemic areas in Ghana indicate that some varieties tested give yields two times higher than the susceptible local cultivars</p>\r\n\r\n			<p><strong><em>Quarantine Measures</em></strong></p>\r\n\r\n			<p>Cassava stems from fields with visible signs of root rot diseases must not be used as planting materials, even if they look healthy. Stems from such fields are likely to carry spores of root rot fungi.<br />\r\n			&nbsp;<br />\r\n			Localized or national quarantine measures to check movement of planting materials from root rot endemic areas into new localities may be necessary to check the spread of root rot diseases.</p>\r\n\r\n			<p><strong><em>Good Farm Sanitation</em></strong></p>\r\n\r\n			<p>Destruction of plant debris including rotten roots (Figure 19) and stems bearing fruiting bodies (Figure 20) immediately after harvest is a good measure that destroys spores of pathogenic fungi. The leathery fruiting body in Figure 20 after harvest can persist for over a year and is a good source of spores for new attacks in the subsequent season&rsquo;s crops. Disease severity on farms can be reduced through destruction of debris that carry spores into the next planting season.<br />\r\n			<br />\r\n			Fruiting bodies of parasitic mushrooms such as&nbsp;<em>Polyporus sulphureus</em>&nbsp;start their development on cassava plants after the first few rains following the dry season. Regular harvesting and destruction of young fruiting bodies shortly after they appear and destroying them through burning reduces severity of rots on farms. Harvesting and destroying the fruiting bodies soon after they appear prevent them from producing spores required for the spread of the disease.</p>\r\n\r\n			<p><strong>Early Harvesting</strong></p>\r\n\r\n			<p>Some root rot causing organisms actively invade and degrade storage roots when they are well developed and harvesting is delayed. Early harvesting therefore prevents or reduces&nbsp; incidence of rots in some varieties of cassava.</p>\r\n\r\n			<p><strong>Avoid Planting Cassava as the first crop</strong></p>\r\n\r\n			<p>Certain parasitic mushrooms can grow on woody trees or cassava depending on which one is available or preferred. It is therefore not advisable to cultivate cassava as the first crop just after clearing forests or woodlands. In the absence of woody trees, introduced cassava plants will be attacked. Woody stumps left on farms after clearing woodlands may serve as secondary hosts or reservoirs to fungal pathogens that attack cassava. It is therefore a good practice to remove stumps from cleared fields.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 2),
(7, '<p>Cassava anthracnose disease (CAD) is widespread in most of the cassava growing regions of Africa. The disease is caused by a fungus (<em>Collectothricum gloeosporioides</em>) that is also capable of causing diseases on other food crops. It is estimated that CAD causes yield losses in the neighbourhood of 30% or more in susceptible cultivars. The disease affects both leaf and stem production. Severe anthracnose attacks can cause death of stems which can affect the availability of planting materials especially in large scale production systems.</p>\r\n\r\n<p><strong>Transmission of the Disease</strong></p>\r\n\r\n<p>Spores of the disease causing fungus are spread by wind or rain splashes and may gain entry through wounds on stems to establish the disease. Feeding holes made by the sap feeding bug&nbsp;<em>Pseudotheraptus devastans</em>&nbsp;may also be the entry holes for the spores of the causal organism.<br />\r\n&nbsp;<br />\r\nPlanting stem cuttings bearing cankers of the disease is one of the means of spreading the disease into new areas. Shoots that develop from cuttings bearing cankers develop symptoms of the disease early and are likely to suffer higher yield losses.</p>\r\n\r\n<p><strong>Control</strong></p>\r\n\r\n<p><em><strong>Resistant Varieties</strong></em></p>\r\n\r\n<p>The most reliable control measure is to use desired anthracnose resistant varieties particularly in localities with high CAD pressures. Cultivation of disease resistant or tolerant varieties is even more important in large scale production systems that require stable high yields to feed industries that depend mainly on cassava as raw material.</p>\r\n\r\n<p><em><strong>Healthy Planting Material</strong></em></p>\r\n\r\n<p>In situations where desired varieties are susceptible to CAD, healthy stems free of cankers and dieback tissues must be selected to provide cuttings for new plantings.<br />\r\nHealthy cuttings sprout well and give rise to young vigorous growing plants that are likely to escape early infections. Where canker bearing stems are the only available sources of planting materials, stem cuttings must be dipped in appropriate fungicides recommended by extension agents in their operational areas. Spores and other fungal materials of disease causing fungi can be destroyed by a few minutes of dipping in suitable fungicides.</p>\r\n\r\n<p><strong><em>Farm Sanitation</em></strong></p>\r\n\r\n<p>Stems and leaves from infected plants after harvest must be destroyed by burning to reduce the amount of fungal spores and other infective structures that can cause infections in the next generation of plants.</p>\r\n\r\n<p><em><strong>Host Range of Causal Organism</strong></em></p>\r\n\r\n<p>The fungus that causes cassava anthracnose can also cause diseases on other food crops such as pepper, avocado, banana, pawpaw and yam. Spores therefore can be transferred from these plants to cause infections in cassava. Plant debris from plants suspected to be harboring the anthracnose causing fungus must be destroyed by burning, particularly during land preparation before cassava is planted.</p>\r\n', 5);

