INSERT INTO `survey_solutions` (`solution_id`, `crop_id`, `cassava_type`, `stage`, `solution`) VALUES
(8, 2, 7, 0, '<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Land Selection &amp; Preparation</strong></div>\r\n\r\n<p>Ideally, fertile land on a flat terrain or gentle slope should be selected. Farmers often rely on their traditional knowledge and observations, such as presence of certain plant species or earthworm casts, as an indicator of fertile soils. Steep slopes should be avoided as they could be erosion-prone. If starting from a fallow, 3-5 years of fallow is optimum. Land preparation Land preparation depends on whether the land:</p>\r\n\r\n<ul>\r\n	<li>has previously been under cultivation</li>\r\n	<li>has been under a short natural or managed fallow</li>\r\n	<li>has been under a long fallow (more than 5 years) &ndash; natural or planted, e.g. alley cropping</li>\r\n	<li>is young forest growth, mature secondary forest or virgin forest.</li>\r\n</ul>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Soil tillage</strong></div>\r\n\r\n<p>Tillage involves all forms of moving and turning the soil:</p>\r\n\r\n<ul>\r\n	<li>Ploughing to 15-30 cm depth</li>\r\n	<li>Disc harrowing to a depth of about 10 cm to produce friable topsoil</li>\r\n	<li>Ridging.</li>\r\n</ul>\r\n\r\n<p>In general, root crops, especially yam and cassava, are not amenable to zero tillage or other forms of conservation agriculture. Under a mechanized system, the best option is to carry out any single or combination of the above-listed tillage operations in order to achieve weed removal, biomass incorporation and good establishment of the cassava cuttings, easier weed control later in the season, easier harvesting and higher yields. However, handmade (hoe) mounds or ridges serve the same purpose in a smallholder, non-mechanized system, which is more common.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Selection of cassava varieties for planting</strong></div>\r\n\r\n<p>There are many improved varieties of cassava which are adapted to various agro-ecological zones and production purposes. Usually, farmers tend to know the varieties which are locally preferred and available. In commercial cassava production, market requirements are a major consideration in deciding the variety to plant. In both commercial and subsistence production it is recommended that farmers should use disease-resistant varieties. Farmers should be advised to check with local extension advisors for information on the common prevalent diseases in the locality and the varieties that are resistant to these diseases. When introducing new varieties, exposing farmers to demonstration plots and making them aware of the potential commercial utilization&nbsp;of cassava can be an effective approach for kindling interest in adoption of the varieties.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Selection and planting of cassava cuttings</strong></div>\r\n\r\n<p>Once the variety to be grown has been selected, the farmer should ensure that the plants from which the cuttings are taken are free of signs of disease, such as cassava mosaic disease and anthracnose, the implements used to cut plants are clean and have not been used on sick plants, and that the cuttings themselves are:</p>\r\n\r\n<ul>\r\n	<li>freshly harvested (of at least 2 cm diameter and 20-25 cm long), ideally taken from the bottom-end of the stem and not with green bark or still bearing leaves (Photo 3)</li>\r\n	<li>clean-cut, not splintered and bark not chipped off (cut with a sharp implement and handle the cuttings with care to avoid damage)&nbsp;</li>\r\n</ul>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:133px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:171px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:131px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:177px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<ul>\r\n	<li>kept upright in the shade with the base partly buried in the soil to avoid drying (if there is need for temporary storage) If there is need to store planting material for a longer time, long stems can be stored upright under a tree, with the bases buried in moist soil. At planting, the top and bottom ends of the stem should be cut off and discarded, the rest of the stem should be cut to the right size for planting.</li>\r\n</ul>\r\n\r\n<p><strong>Planting materials:</strong></p>\r\n\r\n<ul>\r\n	<li>The portion of cassava stem suitable for planting is between the upper and lower points held. Where the stem is still green or leaves are, cuttings are not suitable as they may dry out easily</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:273px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:169px\" vspace=\"0\" /></p>\r\n\r\n<ul>\r\n	<li>Reasonable length, 25&ndash;35 cm cassava cuttings with around 8 nodes</li>\r\n	<li>Reasonably sized cuttings of 2.5 to 3 cm diameter</li>\r\n	<li>Correctly cut materials with minimal splintering and chipping off of bark due to cutting with sharp tools</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:131px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:172px\" vspace=\"0\" /></p>\r\n\r\n<ul>\r\n	<li>Badly cut planting materials with severe splintering and chipping off of the bark due to the use of blunt tools</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:135px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:171px\" vspace=\"0\" /></p>\r\n');
INSERT INTO `survey_solutions` (`solution_id`, `crop_id`, `cassava_type`, `stage`, `solution`) VALUES
(12, 2, 7, 1, '<p>Cuttings can be planted on ridges, mounds or, if the soil is soft but not waterlogged, on flat ground. Planting is done manually using a cutlass (machete) to make a hole. Then the cutting should be inserted vertically or at an angle of about 45&deg;. Cuttings can also be pushed into the soil directly by hand. If planted on ridges or mounds, the base of the cutting should be located near the centre of the ridge or mound.</p>\r\n\r\n<p>This helps to increase the stability of the cassava stand and makes it more resistant to being moved by the wind. Two-thirds of the cutting should be below the soil with the remaining one-third above the ground. In general, cassava planting is carried out manually. There are currently no established mechanical planting operations for cassava that can insert the planting stick vertically or at a 45&deg; angle: all mechanical planters apply the stick horizontally in the soil, a technique that has been shown not to attain maximum yields.</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:136px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:404px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:137px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:405px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row row-2\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:135px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:202px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Planting cassava</strong></div>\r\n\r\n<p>(A) Digging a planting hole</p>\r\n\r\n<p>(B) Inserting the stake on the crest of the ridge&nbsp;</p>\r\n\r\n<p>(C) Pressing the soil around the planted stake to ensure good cover and contact with the soil&nbsp;</p>\r\n\r\n<p>(D) Cutlass across planting stakes indicating the depth to which they should be inserted into the soil &ndash; right hand side underground / left hand side aboveground (roughly 2/3 underground, 1/3 above ground)&nbsp;</p>\r\n\r\n<p>(E) Newly planted cassava field after ridging with a tractor, rows are visible due to exact distances between stakes on the ridges&nbsp;</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Spacing</strong></div>\r\n\r\n<p>The currently recommended spacing is a square arrangement, 1 m x 1 m, i.e. one cassava plant per square metre. This gives 10,000 plants per hectare. For varieties that grow upright without branching (as opposed to low and profusely branching varieties), a higher density of 1 m x 0.5 m or 1 m x 0.75 m may be used.</p>\r\n\r\n<p>For multiplication of stems, rather than production of roots, a closer spacing of 0.5 m x 0.5 m can be used.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Spacing in cassava intercrops</strong></div>\r\n\r\n<p>The recommended optimal planting density in a cassavamaize intercrop is 10,000 cassava plants (1 m x 1 m spacing) and 40,000&ndash;50,000 maize plants per hectare.</p>\r\n\r\n<p>Maize should be planted at 20 cm linear spacing with one plant per stand&nbsp;&ndash; avoid clusters of several maize plants in the same stand. This arrangement is most likely to have little or no detrimental effect on the cassava yield. The maize is sown in a single row between the cassava rows. Irrespective of the type of legume intercropped with cassava, the plant density of cassava should remain at 10,000 per hectare.</p>\r\n\r\n<p>The spacing for the legumes varies with the type of legume used as intercrop: For groundnuts, the recommended planting arrangement is to broadcast at 25 plants per square metre. For soybean and cowpea, two rows can be planted between the rows of cassava, while for pigeonpeas, which grow taller, a single row can be sown.</p>\r\n\r\n<p>Experienced farmers know how to position the accompanying crops relative to the position of the cassava; however, a minimum distance for those seeded in rows is recommended so weeding can still be done along the rows. For some legumes it may be recommended to increase the distance between cassava rows but reduce the distance within the cassava rows so to retain the 10,000 per hectare cassava density yet provide larger space for the legumes.</p>\r\n\r\n<p>For example cassava can be planted at 1.5 m distance between rows yet at 0.67 m distance within the row, or at 2 m between rows and 0.5 m within the rows. In all cases cassava density is 10,000 per hectare but operations for the intercropped legume are easier and may produce higher yields because more space is allocated to them. After the legume harvest, widely spaced rows could be filled with additional cassava plants.</p>\r\n\r\n<p>If using ridges or mounds, as a general rule erect growing intercrops (such as maize and soybean) are planted half-way down the side of the ridge or mound; more spreading intercrops (such as groundnuts) should be planted first (before cassava) on top of the ridge or mound. If it is a supporting crop to cassava, it should be planted between the ridges. The timing for planting of the accompanying crops depends on the crops involved. Generally, yams, legumes, melons and maize are planted first before cassava.</p>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:283px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:501px\" vspace=\"0\" /></p>\r\n\r\n<p><strong>Picture:&nbsp;</strong>Suggested arrangement of intercrop</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Replacement of failures</strong></div>\r\n\r\n<p>Under normal conditions, about 90% of all cassava cuttings planted sprout within 2 weeks of planting. Cuttings that do not sprout should be removed and disposed of away from the cropping area in order to prevent the transmission of any disease that may have caused the failure of the cuttings (Photo 7). New healthy cuttings should be acquired and planted by the third week after the initial planting in order to maintain the planned plant density.</p>\r\n\r\n<p>However, the new cuttings should not be planted in exactly the same hole from which the failed cuttings were removed, to avoid the risk of repetition of the original problem. Drought conditions could cause a much higher failure rate. In such a situation, the farmer should wait until rains resume before replacing failures. If the higher failure rate is due to other factors, the extension worker should seek advice from the nearest agricultural research station or some other accessible expert.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Weed control </strong></div>\r\n\r\n<p>Weeds can retard the growth and reduce the performance of cassava. A well-weeded cassava farm can yield 30&ndash;40% more roots than a poorly weeded farm. Weed control forms a significant part (30% - 50%) of the labour costs in cassava production. The exact weeding frequency will depend on the type and severity of the local weed problem, but in general: It is important to start weed control 3&ndash;4 weeks after planting. This can be done at the same time as the replacement of the failed&nbsp;cuttings (in week 3) in order to maximize the use of labour.</p>\r\n\r\n<p>Weeding should be repeated in weeks 8 and 12, while the final weeding should be done between 20 and 24 weeks after planting, depending on the rainfall. During dry phases weeding may not be required but it is always recommended to destroy weeds before dry phases and after the resumption of rains. Once the canopy of the cassava and of the intercrops (if any) has closed the shading will effectively control most weed growth.</p>\r\n\r\n<p>The overall total number of weeding cycles depends, in part, on the resilience of the weeds, and this depends on agro-ecological conditions. Weeding can be done manually (hoe and cutlass), mechanically (using a tractor) or chemically (although there are no specifically prescribed herbicides for cassava). However, mechanical weeding beyond the first 4 weeks after planting can damage the roots.</p>\r\n\r\n<p>Therefore, manual or chemical weed control is preferred after this period. Farmers should use their local knowledge to decide which weeded material should be left on the plot or removed and discarded. Generally, small broad-leaved weeds can be left on the field because they will die from the heat of the sun and become mulch. Bulky weeds, weeds with rhizomes and weed species with the capacity to form roots from stem pieces tend to re-sprout if cut and left on the soil surface, so the farmer should uproot and dispose of these types of weeds away from the field. Tall grasses should be uprooted and removed from the field before they flower in order to prevent seed formation and germination, which will further propagate the weed species. When cassava is intercropped with legumes this limits the choice of herbicides that can be used. Expert assistance should be sought from local officials who can supply a list of suitable and legally permitted herbicides. In some parts of Africa, chemical weed control services are offered by trained mobile operators; if available, this might be a good option for farmers.</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:162px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:482px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:160px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:240px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row row-2\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Germinating cassava</strong></div>\r\n\r\n<p>(A) Germinating cassava planted on ridges</p>\r\n\r\n<p>(B) Typical error in planting &ndash; the cutting was inserted upside down and the shoot is emerging from underground</p>\r\n\r\n<p>(C) Replacing non germinated or wrongly inserted cassava cuttings at around 4 weeks after planting</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Nutrient management</strong></div>\r\n\r\n<p><strong>Fertilizer use</strong></p>\r\n\r\n<p>By applying mineral fertilizers to their cassava, smallholder farmers can increase their yields from about 10 tonnes to as much as 16 tonnes of fresh roots per hectare. The application of nutrients helps to replace the lost nutrients and maintain soil fertility to enable continuing good yields in subsequent farming seasons. Determining the exact quantity of fertilizers to apply on a given plot depends on many factors and can vary from one soil type to another. However, a simple way to determine the fertilizer requirement is linked to the cassava root yield. Let&rsquo;s assume that the natural soil nutrient reserves are sufficient to produce around 10 tonnes per hectare of fresh cassava roots. For every one tonne of fresh cassava roots harvested, including leaves and stems, about 10 kg of nitrogen (N), 1 kg of phosphorus (P) and 7 kg of potassium (K) are removed from the soil. So, the additional nutrients removed from the soil to achieve 16 tonnes per hectare compared to 10 tonnes are 60 kg N, 6 kg P and 42 kg K per hectare. Not all fertilizer applied to the soil is taken up by the target crop: on average only about half is taken up by the plant. So, to supply 60 kg N, 6 kg P and 42 kg K (to enable production of 16 tonnes fresh roots per hectare), the farmer needs to apply twice as much - that is 120 kg N, 12 kg P and 84 kg K per hectare. In the sections that follow, examples are given showing how these amounts of nutrients can be supplied by the application of different types of fertilizers.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>NPK fertilizers</strong></div>\r\n\r\n<p>There are two main types of fertilizers, compound fertilizers that&nbsp;supply several nutrients together and straight fertilizers that supply just a single nutrient. This section deals with NPK fertilizers, which are good examples of the first type. Standard compound fertilizers, known as N-P-K, supply nitrogen (N), phosphorus (P) and potassium (K). Most of the N-P-K products show the combination of these three nutrients in ratio form, for example N-P-K 15-15-15, which contains 15% N, 15% P2 O5 and 15% K2 O1 .</p>\r\n\r\n<p>Other N-P-K formulations are available that provide other relative proportions of nutrients; for example, N-P-K 17-17-17 contains 17% N, 17% P2 O5 and 17% K2O. If a farmer, who currently achieves a yield of around 10 tonnes per hectare without the use of any fertilizer, wishes to increase their yield to 16 tonnes per hectare, they can do so by applying NPK fertilizer &ndash; as well as following the other recommendations provided in this guide. Table 2 shows the amount of either NPK 15-15-15 or NPK 17-17-17 that should be applied.</p>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:74px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:483px\" vspace=\"0\" /></p>\r\n\r\n<p><em>Amount of NPK fertilizer needed to increase yields from 10 to 16 tonnes fresh roots per hectare.</em></p>\r\n\r\n<p>In case a farmer cannot afford to buy enough fertilizer to support a yield of 16 tonnes per hectare, the following table shows the amount of NPK fertilizer needed to achieve a range of yields from 10 to 16 tonnes fresh roots per hectare.</p>\r\n');
INSERT INTO `survey_solutions` (`solution_id`, `crop_id`, `cassava_type`, `stage`, `solution`) VALUES
(13, 2, 7, 2, '<p>To harvest cassava manually, do the following:</p>\r\n\r\n<ul>\r\n	<li>Cut the stem at knee to waist height (as preferred)</li>\r\n	<li>Use a hoe or cutlass to free the roots</li>\r\n	<li>&nbsp;Avoid damaging the cassava roots</li>\r\n	<li>Pull out the roots by hand&nbsp;</li>\r\n	<li>Check the base of the cassava for any broken-off roots and dig for them out of the soil</li>\r\n</ul>\r\n\r\n<p>For mechanical harvesting, a special cassava harvesting tool has been developed which employs the principle of leverage and therefore makes the task easier. There is also a tractor-pulled cassava harvester.&nbsp;</p>\r\n\r\n<p>On a well-managed cassava farm planted at the recommended density of 10,000 plants per hectare, each cassava stand will need to produce an average of 1.6 kg of useful roots to generate 16 tonnes of fresh cassava roots per hectare. When processed this will give about 3.2&ndash;4 tonnes of edible dry matter.</p>\r\n\r\n<p>Cassava leaves can also be harvested periodically and used as a leafy green vegetable. There is varietal variation, but root yield reductions of up to 40% have been recorded where leaves are harvested. The farmer should be aware that harvesting the cassava leaves may reduce the root yield.</p>\r\n\r\n<p>This crop becomes ready for harvesting in about 12 months of the plantation on the main field whereas short duration variety takes about 6 to 8 months. However, harvesting at the right time helps in obtaining the best quality of tubers in a higher amount.</p>\r\n\r\n<p>This commercial crop is mainly harvested by hand, by lifting the base of the stem and then pulling it outs. Then they should be removed from the field though hand. Removed the upper portion of plants and stems before harvesting it.</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/jpeg;base64,\" style=\"border:0px solid black; height:567px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:1016px\" vspace=\"0\" /></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>Take care while harvesting roots. While harvesting, your roots should be not be damaged in any way.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Yield in Cassava Farming</strong></div>\r\n\r\n<p>The yield of this commercial crop depends on numbers of key factors such as theagro-climaticc condition, type of soil, the cultivar or variety is chosen for its cultivation along with good farm management skills.</p>\r\n\r\n<p>However, it is possible to harvest about more than 40 tonnes of roots with good farm management skills through growing high yielding hybrid and for short-term variety, you can harvest roots, about more than 30 tonnes from a hectare land.</p>\r\n\r\n<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>Economics of cassava systems</strong></div>\r\n\r\n<p>It is important to have an idea of whether a new farming practice, such as use of fertilizer, will be profitable (before introduction) and whether the technology is actually profitable (after introduction). The likely benefits of a new practice are calculated based on estimated data while actual benefits are based on actual data collected after introduction of the new farming practice. Simple calculations can provide useful insights into the likely costs and benefits while needing only a minimal amount of data/ information. For example, if a farmer who has been obtaining yields of 10 tonnes per hectare of fresh roots with no fertilizer decided to use 16 bags each of 50 kg of N-P-K 15-15-15, the increase in yield required to recover the additional cost of fertilizes (assuming price of N-P-K is USD 25 per 50 kg bag, and price of cassava is USD 40/tonne fresh roots) can be calculated as:</p>\r\n\r\n<p><img alt=\"\" border=\"0\" hspace=\"0\" src=\"data:image/png;base64,\" style=\"border:0px solid black; height:81px; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:0px; width:338px\" vspace=\"0\" /></p>\r\n\r\n<p>So, in this example, the farmer would need to obtain 20 tonnes per hectare just to recover the cost of the investment in fertilizer. To take the analysis a step further, the extra costs incurred with use of a new technology can be compared with the additional benefits obtained through the use of the technology. For example, if in the above example the previous yield was 10 tonnes per hectare but with use of 16 bags of N-P-K fertilizer per hectare the yield increased to 21 tonnes for a cassava variety that responded well&nbsp;to fertilizer (&lsquo;efficient variety&rsquo;) and 13 tonnes for a variety that responded poorly to fertilizer (&lsquo;inefficient variety&rsquo;) the economic benefits can be calculated using the following steps:&nbsp;</p>\r\n\r\n<p>Step 1: Calculate the change in yield brought about by use of fertilizer</p>\r\n\r\n<p>Step 2: How much the change in yield is worth</p>\r\n\r\n<p>Step 3: The amount of money required to purchase fertilizer</p>\r\n\r\n<p>Step 4: How much money the farmer is left with after deducting cost of fertilizer</p>\r\n\r\n<p>Step 5: The value of yield can be compared with the costs, in the value/cost ratio (VCR)</p>\r\n\r\n<p>As a rule of thumb, a value/cost ratio greater than 2 is needed for an investment to be economically attractive to farmers. So, in the above example use of fertilizer would not have been costeffective; a significantly higher price for cassava would need to be obtained for this level of fertilizer usage to make economic sense. If additional information, for example on costs of labour, is available, more detailed calculations can be carried out.</p>\r\n\r\n<p>Reductions in costs of labour due to herbicide application may prove economical, particularly where persistent weeds are present. Remember, the best use of a resource should be explored in order to get the best return from the input. A point to note is that prices of inputs and yields of crops can vary. For example, better incomes could perhaps be obtained by processing raw cassava roots into an added value product. Also less fertilizer should be applied when rains are late and drought is expected, and more fertilizer can be used when rains are on time and adequate.</p>\r\n');
COMMIT;

